import axios from "axios";
import { useEffect } from "react";
function userdata() {
  useEffect(() => {
    axios
      .get(
        `https://jsonplaceholder.typicode.com/posts`
      )
      .then((response) => {
        const posts = response.data;
        console.log({ posts });
      });
  })

}
